translated_text:
Merina Malagasy: Taorian’ny fandanian’ny kongresy azy ny 4 Jolay, nisy dika mitovy natao sora-tanana nosoniavin’ny Filohan’ny Kongresy Jaona Hankoka sy ny Sekretera Charles Thomson ary avy eo nalefa tao amin’ny fanaovana pirinty Jaona Donlapy izay tsy lavitra teo. 
English:
The meeting of the 4th Congress of the French Revolutionary Party, held on the 4th of July, was attended by the following delegates:
The Honorable Charles Thomson, Secretary of the Congress;
The Honorable Jaona Donlapy, President of the Congress;
The Honorable Jean Baptiste Drouet, President of the Council of the Commune of Paris;
The Honorable Jean Baptiste Drouet, President of the Council of the Commune of Paris;
The Honor

